function clickfunc(nuppstr){
    $(nuppstr).trigger('mouseup');
    return;
}

function clickfunc2(nuppstr){
    if ( $( "#Punakas" ).length ) {
        var leidsin = 0;
        for (var i = 1; i < 10; i++) {
            var btn = $("#valik" + i);
          	var text = btn.text();
            if( text.includes($("#maavarascript").val())){
                if((text.length - $("#maavarascript").val().length) < 10 )
                    leidsin = i;
            }
        }
        if (leidsin == 0){
             $("#otsi").trigger('mouseup');
        } else {
             $("#valik" + leidsin).trigger('mouseup');
        }
    } else {
        $(nuppstr).trigger('mouseup');
    }
    return;
}

